export const base_uri = `https://itubelite.flashup24.com/backend`;

export const SignUp = {
    uri: `${base_uri}/user`,
    method: 'post'
}
export const SignIn = {
    uri: `${base_uri}/user/signin`,
    method: 'post'
}
